import React from "react";
import "../styles/footer.scss"

export const Footer: React.FunctionComponent = () => {
    const currentYear = new Date().getFullYear();

    return (
        <footer className="footer">
            <div className="content">
                <p>@ {currentYear} </p>
            </div>
        </footer>
    )
}
